INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("フリーマーケット会場", 7, 20063115, 1, 40, 0, 8, 2834, 10118, 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", "ペコリーヌとの出会い", 91002, 2, "青空の下で謁見");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("フリーマーケット会場", 7, 20063115, 1, 40, 0, 8, 2835, 10118, 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", "マホとの出会い", 91002, 2, "未来の騎空団\nマスコット？");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("ランドソル市街地", 7, 20063115, 1, 40, 0, 8, 2837, 10118, 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", "アキノとの出会い", 91002, 2, "お嬢さまからの\n緊急依頼");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("フリーマーケット会場", 18, 20063115, 1, 40, 0, 8, 4108402, 10118, 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", "ジュンとの出会い", 91002, 2, "黄金色の悩みごと");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("フリーマーケット会場", 18, 20063115, 1, 40, 0, 8, 4107402, 10118, 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", "カオリとの出会い", 91002, 2, "白熱！　格闘大会！");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("オーエド町", 16, 20063115, 1, 40, 1, 8, 9000227, 10118, 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", "ニノンとの出会い", 91002, 2, "祭り太鼓はオーエドの華");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("フリーマーケット会場", 19, 20063115, 1, 40, 0, 8, 2101181, 10118, 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", "スズナとの出会い", 91002, 3, "人気者は遅れて\nやってくる");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("ランドソル市街地", 18, 20063115, 1, 40, 0, 8, 4109402, 10118, 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", "ナナカとの出会い", 91002, 3, "巫女・ミーツ・魔法少女");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("フリーマーケット会場", 18, 20063115, 1, 40, 0, 8, 4305402, 10118, 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", "キャル＆コッコロとの出会い", 91002, 3, "ネズ耳は二度なくなる");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("ランドソル市街地", 18, 20063115, 1, 40, 0, 8, 4101402, 10118, 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", "ユカリとの出会い", 91002, 3, "この出会いにカンパイ！");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("ランドソル市街地", 18, 20063115, 1, 40, 0, 8, 4106402, 10118, 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", "アオイとの出会い", 91002, 3, "陰陽アンサンブル");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES ("フリーマーケット会場", 7, 20063115, 1, 40, 1, 8, 2836, 10118, 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", "シノブとの出会い", 91002, 3, "運試し十番勝負！");
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (0, 0, 20063115, 0, 0, 0, 0, 0, 10118, 5118600, 0, "オープニング", 0, 1, "彼女たちの新たな日常");
